import React from 'react';

type VentProps = {
    leftOnePercent: number
    leftTwoPercent: number;
    rightOnePercent: number
    rightTwoPercent: number;
};
const MyLineComponent = () => {
    const lineStyle = {
      borderTop: '2px solid green', // Set the border style to create a green line
      margin: '10px 0', // Optional: Add some margin for spacing
    };

    return (
      <div style={lineStyle}>
      </div>
    )
  }


const Vents: React.FC<VentProps> = ({ leftOnePercent, 
    leftTwoPercent, rightOnePercent, rightTwoPercent }) => {
    return (
        <div  style={{display: 'flex', padding: '0px 56.5px 0px 55.5px', width:'50vw', height:'178px',
        borderRadius: '10px', backgroundColor: '#315B0F', 
boxShadow: '0px 4px 4px 0px rgba(0, 0, 0, 0.25), 0px 4px 4px 0px rgba(0, 0, 0, 0.25)', justifyContent: 'center', alignItems: 'center', alignSelf: 'stretch'}}>
            <MyLineComponent/>
            <MyLineComponent/>
            <MyLineComponent/>
            <MyLineComponent/>
        </div>
    );
};

export default Vents
